// 컴포넌트 생성
function Header() {
    return (
        <header>
            <h1>logo</h1>
        </header>
    );
}

function App() {
    return (
        <div className="root">
            <nav>
                <ul>
                    <li>
                        <a href="/sub/html">html</a>
                    </li>
                    <li>
                        <a href="/sub/css">css</a>
                    </li>
                    <li>
                        <a href="/sub/js">js</a>
                    </li>
                </ul>
            </nav>
            <article>
                <h2>타이틀</h2>
                Hello, React!
            </article>
        </div>
    );
}

export default App;
